(971, '_transient_vlog_mksaw', '<p><a href="https://mekshq.com/?utm_source=vlog&utm_medium=banner&utm_campaign=admin%20widget" target="_blank"><img style="max-width:100%; margin-top:5px;" src="https://mekshq.com/static/meks_small_banner.jpg"/></a></p><p>\r\nYou are currently using <strong>Vlog</strong>, a WordPress theme by <a href="https://mekshq.com" target="_blank">Meks</a>.<br/>\r\nThank you for choosing us - we really appreciate your trust!\r\n</p>\r\n<div class="mksaw_hr"></div>\r\n<h4><strong>Need help?</strong></h4>\r\n<p>\r\nCheck documentation first for explanation how to setup this theme. If you get stuck, do not hesitate to contact our support.\r\n</p>\r\n<p>\r\n	<a class="button-primary" href="https://mekshq.com/documentation/vlog" target="_blank">Documentation</a> <a class="button-primary" href="https://mekshq.com/contact" target="_blank">Contact support</a>\r\n</p>\r\n<div class="mksaw_hr"></div>\r\n<h4><strong>About Meks</strong></h4>\r\n<p>\r\nWe are a team of passionate professionals\r\ndedicated to providing premium level WordPress services & products.\r\n</p>\r\n<p>\r\n	<a class="button-primary" href="https://mekshq.com/themes/?utm_source=vlog&utm_medium=button-themes&utm_campaign=admin%20widget" target="_blank">View our themes</a> <a class="button-primary" href="https://mekshq.com/plugins/?utm_source=vlog&utm_medium=button-plugins&utm_campaign=admin%20widget" target="_blank">View our plugins</a>\r\n</p>\r\n<div class="mksaw_hr"></div>\r\n<h4><strong>Stay in touch</strong></h4>\r\n<ul class="mksaw_social">\r\n<li class="mksaw_facebook"><a href="https://www.facebook.com/mekshq" target="_blank"><i class="dashicons dashicons-facebook-alt"></i><span>Like us on Facebook</span></a></li>\r\n<li class="mksaw_twitter"><a href="https://twitter.com/mekshq" target="_blank"><i class="dashicons dashicons-twitter"></i><span>Follow us on Twitter</span></a></li>\r\n<li class="mksaw_newsletter"><a href="https://eepurl.com/TBPOb" target="_blank"><i class="dashicons dashicons-email-alt"></i><span>Subscribe to our newsletter</span></a></li>\r\n</ul>\r\n<style>\r\n.mksaw_social li{display: inline-block; vertical-align: top; width: 125px;}\r\n.mksaw_social li.mksaw_twitter{width: 110px; margin-right: 15px;}\r\n.mksaw_social a i{color: #FFF;border-radius: 50%;height: 22px;width: 32px;font-size: 22px;padding: 5px 0;margin-right: 5px;float: left;}\r\n.mksaw_facebook a i{background: #2672a2;}\r\n.mksaw_twitter a i{background: #59b4ed;}\r\n.mksaw_newsletter a i{background: #f4ba49;}\r\n.mksaw_facebook a span{color:#2672a2;}\r\n.mksaw_twitter a span{color:#59b4ed;}\r\n.mksaw_newsletter a span{color: #943d08;}\r\n.mksaw_hr{height: 1px; width: 100%; display: block; float: left; clear: both; background: #eeeeee; margin: 10px 0 16px;}\r\n.mksaw_social li.mksaw_newsletter {width: 126px;}\r\n</style>\r\n<div class="mksaw_hr"></div><h4><strong>A moment of inspiration</strong></h4><p style="font-family: Georgia, serif; font-size: 16px; line-height: 24px; color: #666; padding: 15px; border: 1px solid #e2e2e2; background: #f3f3f3;">"Keep your face to the sunshine and you cannot see a shadow."<br><span style="margin-top: 5px; font-size: 14px; display: block;">-  Helen Keller\r\n</span></p>', 'no'),
