(1, 1, '2017-11-30 13:04:48', '2017-11-30 11:04:48', 'Tere tulemast WordPressi. See on sinu esimene postitus. Muuda seda või kustuta see ning alusta blogimist!', 'Tere-tere!', '', 'publish', 'open', 'open', '', 'tere-tere', '', '', '2017-12-07 13:17:33', '2017-12-07 11:17:33', '', 0, 'http://levelup.ee/sandbox/?p=1', 0, 'post', '', 1),
(2, 1, '2017-11-30 13:04:48', '2017-11-30 11:04:48', 'See on näidisleht. See erineb postitusest selle poolest, et jääb ühte kohta ja paistab navigeerimismenüüst (enamiku teemade puhul). Enamasti alustatakse enda kohta käivast lehest, mis tutvustab lehe omanikku külastajatele. Näiteks nii:\n\n<blockquote>Tere! Ma olen päeval kuller, õhtul algaja näitleja. See on minu veebileht. Ma elan Los Angeleses, mul on lahe koer nimega Jack ning ma armastan kokteile (ja vihma kätte jääda).</blockquote>\n\n...või nii:\n\n<blockquote>Jubinavabrik XYZ asutati1971 ja on sellest ajast peale pakkunud kõrgekvaliteedilisi jubinaid.  XYZ asub Gotham Citys, annab tööd üle 2000 inimesele ja teeb ka muidu linnas igasugu vingeid asju.</blockquote>\n\nUue WordPressi kasutajana võiksid minna <a href="http://levelup.ee/sandbox/wp-admin/">töölauale</a>, kustutada selle lehe ja luua ise uued. Jõudu!', 'Näidisleht', '', 'publish', 'closed', 'open', '', 'demoleht', '', '', '2017-11-30 13:04:48', '2017-11-30 11:04:48', '', 0, 'http://levelup.ee/sandbox/?page_id=2', 0, 'page', '', 0),
